import * as icons from './icons'
import { Meta } from '@storybook/react'
import { Table } from 'antd'

const allIcons = Object.entries(icons).map(([key, Icon]) => ({ name: key, icon: Icon }))

export default {
    title: 'Layout/Icons',
    parameters: { options: { showPanel: false } },
} as Meta

